	(36, 'Yêu thích+Đồng Hồ Nam keepIntooth Chống Nước , chống xước.', 'Mặt đồng hồ Kim- Kỹ thuật số@@@Kiểu vỏ đồng hồ Tròn@@@Chất liệu vỏ đồng hồ Hợp kim@@@Kiểu khóa đồng hồ Khóa gài/móc@@@Chất liệu dây đeo Hợp kim@@@Xuất xứ Nhật Bản@@@Hạn bảo hành 12 tháng@@@Chất liệu Kim loại, Thép, Hợp kim@@@Kho hàng 9994@@@Gửi từ Hải Dương', '<3 SHOP ĐỒNG HỒ PHỤ KIỆN CHÍNH HÃNG XIN KÍNH CHÀO QUÝ KHÁCH \nchúc quý khách ngày mới tốt lành ạ , cám ơn quý khách vì đã ghé thăm shop ạ . shop rất cảm kích vì vậy shop sẽ gửi tới quý vị những sản phẩm tốt nhất VỚI GIÁ THÀNH RẺ NHẤT ạ, hãy theo dõi để xem những mẫu mới về chất lượng nhất ạ\nPHƯƠNG CHÂM CỦA SHOP EM :GIÁ RẺ NHẤT - CHẤT LƯỢNG NHẤT -  UY TÍN - LÀ VÀNG\n-------------------------------------------\nVới sản phẩm đồng hồ nam thời trang #KEEP  Japan DL866  Nam tính , các chàng trai hoàn toàn có thể hô biến nó thành món phụ kiện nổi bật cho phong cáchthời trang riêng của mình và kết hợp với nhiều trang phục khác nhau.Từ thời trang công sở lịch lãm với quần âu, áo sơ mi, vest cho đến thời trang casual hàng ngày với quần Jeans, áo pull hoặc ăn vận như một fashionita với skinny Jeans rách, áo Jacket da, kính mắt...Lựa chọn đồng hồ nam #KEEP   Japan DL866  Chuẩn Man, bạn chắc chắn sẽ là người đàn ông đích thực và “chuẩn không cần chỉnh”.\n\nSản phẩm đồng hồ nam thời trang #KEEP  với mặt đồng hồ được thiết kế đơn giản, tinh tế, toát lên sự thanh lịch, sang trọng nhưng không kém phần thời trang, khỏe khoắn, cá tính\n\n- Mặt đồng hồ tròn, thiết kế đẹp mắt, sáng bóng với tính năng hiện đại cho phái mạnh tự tin, mạng mẽ và thời trang\n\n- Ngoài ra mặt đồng hồ còn được sử dụng chất liệu kính khoáng cao cấp giúp chịu lực tốt, bền đẹp và dễ dàng theo dõi từng chuyển động.\n\n- Dây thép không gỉ thiết kế ôm tay, sang bóng.\n\n- Khả năng chống thấm  cho phép bạn yên tâm khi rửa tay hay đi mưa\n\nTHÔNG SỐ KỸ THUẬT\n- Thương hiệu: #KEEP \n\n- Sản xuất tại: Hồng Kông\n\n- Kiểu máy: Quartz, Máy Nhật\n\n- Dành cho: Nam\n\n- Kích thước mặt: ~ 42mm x 10 mm\n\n- Kích thước dây: Dài x rộng: 24 x 2.0 cm\n- Độ chính xác: +- 20 giây 1 tháng\n- Số kim: 3 kim chạy,  Có lịch ngày, \n_chịu nước 3ATM\n_ Bảo hành 6 tháng\n\n- Loại dây: thép không gỉ (INOX)\n\n- Chất liệu vỏ đồng hồ: thép không gỉ \n\n*  Quy định bảo hành:\n • Thời gian bảo hành: 06 tháng bộ máy\n • Đổi trả trong 7 ngày nếu hàng bị lỗi do nhà sản xuất như là rớt kim, hư khóa, đồng hồ không chạy.\n • Chỉ bảo hành thay thế mới cho những linh kiện, phụ tùng bị hỏng – không thay thế bằng một chiếc đồng hồ khác.\n • Bảo hành online dựa vào ngày nhận hàng trên đơn hàng shopee ghi nhận\n\n* Trường Hợp Không Bảo Hành: \n • Các loại dây đeo, khoá, vỏ, màu xi, mặt số, mặt kiếng bị hỏng hóc, vỡ do sử dụng không đúng, tai nạn, lão hóa tự nhiên, va đập, … trong quá trình sử dụng.\n • Không bảo hành đồng hồ bị vào nước do lỗi của khách hàng như làm hở chốt, không đóng chặt trước khi tiếp xúc nước....\n • Trầy xước về dây hoặc mặt kiếng bị trầy xước, vỡ do va chạm mạnh trong quá trình sử dụng. \n • Tự ý thay đổi máy móc bên trong, mở ra can thiệp sửa chữa trong thời gian còn bảo hành – Tại những nơi không phải là trung tâm của hãng.\n\nHastag: #donghothoitrang  #donghonam  #đồnghồ  #đồnghồnam #đồnghồđẹp #đồnghồdâythép #đồnghồthờitrang  #dongho #đồnghồdâythép #donghogiatot #donghodoanhnhan #đồnghồnam #donghonam #dongho #đồnghồ #donghogiare #đồnghồgiárẻ #chốngnước #', '₫60.000', 0, '', '2022-05-27 21:39:12', '2022-05-27 21:39:12', NULL, 0, 0, 0),
	(37, 'Yêu thích Đồng hồ nam dây đeo thép lưới thời trang dành cho', 'Mặt đồng hồ Kim@@@Đồng hồ đeo tay Thạch anh@@@Kiểu đồng hồ Thời trang@@@Loại bảo hành Không bảo hành@@@Kiểu vỏ đồng hồ Tròn@@@Chất liệu vỏ đồng hồ Thép không gỉ@@@Chất liệu dây đeo Thép không gỉ@@@Kính đồng hồ Kính Thủy tinh@@@Xuất xứ Trung Quốc@@@Hạn bảo hành Không bảo hành@@@Số lượng hàng khuyến mãi 198@@@Số sản phẩm còn lại 57596@@@Gửi từ Nước ngoài', 'Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\n  \n  ♫♫ Lưu ý:\n  ✔ Sản phẩm giá rẻ nhất cùng chất lượng tốt nhất.\n  ✔ Tất cả các sản phẩm đều có hàng sẵn trong kho. \n  ✔ Tất cả các hình ảnh đều được chụp từ sản phẩm thực tế.\n  ✔ Tất cả các sản phẩm đều có hàng sẵn trong kho trừ khi được đánh dấu là "Hết hàng".\n  ✔ Vui lòng chọn các tùy chọn màu sắc sau đó đặt hàng, bởi vì chúng tôi không thể hỗ trợ chọn màu sắc thông qua đánh dấu hoặc tin nhắn. (Nếu ✔ tùy chọn thể hiện: "Ngẫu nhiên hoặc Phân loại", có nghĩa là chúng tôi quyết định màu sắc)\n  ✔ Chúng tôi không hỗ trợ hủy đơn hàng, xin vui lòng đảm bảo chắc chắn nhận hàng sau khi đặt hàng.\n  ✔Hỗ trợ đại lý bán sỉ và lẻ. (Nếu có mác "bán sỉ")\n  \n  Chuyển động: Thạch anh\n  Chất liệu vỏ mặt đồng hồ: Thép không gỉ\n  Phong cách: Thời trang & Thông thường\n  Mã số mẫu: V863\n  Chất liệu dây đeo: Thép không gỉ\n  Chiều rộng dây đeo: 20mm\n  Chiều dài dây đeo: 26cm\n  Độ dày vỏ mặt đồng hồ: 8mm\n  Đường kính mặt đồng hồ: 42mm\n  Hộp đựng: Không có hộp đựng\n  Chất liệu mặt đồng hồ: Kính\n  Hình dạng mặt đồng hồ: Tròn\n  Chống thấm nước: Không chống thấm nước\n  Gói hàng bao gồm: 1 x Đồng hồ đeo tay có pin', '₫56.000', 0, 'Blue White@@@Silver Black@@@Gold Black@@@Silver White@@@Rose Gold Black@@@Rose Gold White@@@Blue Blue@@@Black White@@@Blue Yellow@@@Black Blue@@@Gold White@@@Black Yellow', '2022-05-27 21:39:12', '2022-05-27 21:39:12', NULL, 0, 0, 0),
