mm\n\n- Kích thước dây: Dài x rộng: 24 x 2.0 cm\n- Độ chính xác: +- 20 giây 1 tháng\n- Số kim: 3 kim chạy,  Có lịch ngày, \n_chịu nước 3ATM\n_ Bảo hành 6 tháng\n\n- Loại dây: thép không gỉ (INOX)\n\n- Chất liệu vỏ đồng hồ: thép không gỉ \n\n*  Quy định bảo hành:\n • Thời gian bảo hành: 06 tháng bộ máy\n • Đổi trả trong 7 ngày nếu hàng bị lỗi do nhà sản xuất như là rớt kim, hư khóa, đồng hồ không chạy.\n • Chỉ bảo hành thay thế mới cho những linh kiện, phụ tùng bị hỏng – không thay thế bằng một chiếc đồng hồ khác.\n • Bảo hành online dựa vào ngày nhận hàng trên đơn hàng shopee ghi nhận\n\n* Trường Hợp Không Bảo Hành: \n • Các loại dây đeo, khoá, vỏ, màu xi, mặt số, mặt kiếng bị hỏng hóc, vỡ do sử dụng không đúng, tai nạn, lão hóa tự nhiên, va đập, … trong quá trình sử dụng.\n • Không bảo hành đồng hồ bị vào nước do lỗi của khách hàng như làm hở chốt, không đóng chặt trước khi tiếp xúc nước....\n • Trầy xước về dây hoặc mặt kiếng bị trầy xước, vỡ do va chạm mạnh trong quá trình sử dụng. \n • Tự ý thay đổi máy móc bên trong, mở ra can thiệp sửa chữa trong thời gian còn bảo hành – Tại những nơi không phải là trung tâm của hãng.\n\nHastag: #donghothoitrang  #donghonam  #đồnghồ  #đồnghồnam #đồnghồđẹp #đồnghồdâythép #đồnghồthờitrang  #dongho #đồnghồdâythép #donghogiatot #donghodoanhnhan #đồnghồnam #donghonam #dongho #đồnghồ #donghogiare #đồnghồgiárẻ #chốngnước #', '₫60.000', 0, '', '2022-05-27 21:54:08', '2022-05-27 21:54:08', 0, 0, 0, 0),
