	(79, 'Đồng Hồ Nam Chính Hãng ONTHEEDGE TD1 Thời Trang Dây Da Cao Cấp Có Lịch Ngày Đẹp Giá Rẻ', 'Thương hiệu Kim@@@Mặt đồng hồ Bảo hành nhà cung cấp@@@Loại bảo hành Tròn@@@Kiểu vỏ đồng hồ Hợp kim@@@Chất liệu vỏ đồng hồ Cài khóa@@@Kiểu khóa đồng hồ Da@@@Chất liệu dây đeo Trung Quốc@@@Xuất xứ 12 tháng@@@Hạn bảo hành Da@@@Chất liệu Thành Danh Swatch@@@Tên tổ chức chịu trách nhiệm sản xuất 364 Giải Phóng, Hoàng Mai, Hà Nội@@@Địa chỉ tổ chức chịu trách nhiệm sản xuất 18370@@@Kho hàng Quận Hoàng Mai, Hà Nội@@@Gửi từ undefined', 'THÔNG TIN VỀ SẢN PHẨM\n- KHÔNG CHỈ LÀ 1 chiếc đồng hồ đơn thuần, giờ đây những chiếc đồng hồ ngày càng được cải tiến về cả chất lượng lẫn mẫu mã còn là 1 món đồ trang sức cho bất kì ai trong chúng ta. \n- Thành Danh Swatch xin giới thiệu dòng sản phẩm đồng hồ nam chính hãng OnTheEdge chất lượng cao, mẫu mã đẹp. Thiết kế thời trang sang trọng kiểu gờ đính KIM CƯƠNG lấp lánh, vỏ và khóa đồng hồ được MẠ HỢP KIM tĩnh điện màu vàng gold chống oxy hóa không hại da tay.\n- Được kết hợp với dây da màu NÂU và ĐEN dập vân cá sấu thời trang sản phẩm có thể dễ dàng kết hợp với mọi trang phục đi lam, đi chơi, du lịch hay thể thao.\n- Ngoài ra sản phẩm còn được tích hợp LỊCH NGÀY và LỊCH THỨ tiện lợi.\n- Dây đồng hồ bằng da màu đen và nâu vằn cá sấu dễ dàng kếp hợp nất kì trang phục gì, chất lượng bền dai chống phai màu và úng đong ẩm.\n\n- CAM KẾT hàng đúng quảng cáo, giống ảnh 100%\n- Bộ sản phẩm đầy đủ bao gồm: hộp đựng bằng da, vip card, sách, đồng hồ, thẻ bảo hành, pin tặng thêm\n\n*** THÔNG TIN CHI TIẾT SẢN PHẨM ***\n- Thương hiệu : ONTHEEDGE\n- Động cơ: Japan movement quartz\n- Pin khỏe dùng trên 1 năm mới phải thay\n- Có lịch ngày lịch thứ\n- Mặt tròn size 38mm, độ dày 8mm\n- Kính hardlex  chống xước, chống va đập cao\n- Chống nước 30m \n- Kiểu giờ: đính kim cương, số la mã\n- Có lịch ngày,