	(80, 'Đồng hồ nam ECONOMICSXI hiện đại, chạy ba kim và lịch ngày, mặt kính chống xước có khung kim loại, dây thép lưới đen', 'Mặt đồng hồ Kim@@@Kho hàng 1559@@@Gửi từ Hà Nội', 'THÔNG TIN NỔI BẬT:\n✔ Kiểu dáng năng động và lịch lãm\n✔ Kính tráng cường lực cao cấp chống trầy xước cực phải chăng\n✔ Đồng hồ và hộp chứa sang trọng nên rất thích hợp để làm cho quà tặng\n✔ Không sở hữu bất kì 1 tì vết hay lỗi nhỏ nào trên sản phẩm\n-----------------------------------------------------------------------------------\n➡ THÔNG TIN SẢN PHẨM : \n✔ Đồng Hồ Nam: ECONOMICXI\n✔ Độ chống nước:  cơ bản: đi mưa nhỏ, rửa tay ok\n✔ Dây thép mành đen\n✔ Khoá bấm cao cấp\n✔ Kích thước mặt: đường kính 40mm\n✔ Chiều dày: ~10mm\n✔ Kích thước dây: dài 24 cm \n✔ Độ rộng dây: 2 cm\n✔ Số Kim: Chạy 3 kim (giờ, phút, giây) và lịch ngày\n✔ Máy: Quartz\n✔ Mặt kính: cường lực cao cấp\n✔ Pin sử dụng từ 18 tháng tới - 2 năm ( Hết pin có thể thay pin sd tiếp ạ )\n✔ Giao hàng toàn quốc\n- Không bảo hành\n- Bộ sản phẩm bao gồm: 1 Đồng hồ và Hộp đựng .\n-----------------------------------------------------------------------------------\n➡ Những CAM KẾT khi mua tại Shop\n- Cam kết về sản phẩm: Sản phẩm này 100% giống hệt ảnh.\n\n- Về size đồng hồ: Anh chị em mang có thể giảm bớt mắt dây để đeo cho vừa tay nhé (giống như lên lai quần), vui lòng nhắn cho shop để được hướng dẫn cụ thể\n\n----------------------------------------------\nXu Hướng Của Năm:\n#dongho #donghonam #donghonu #donghogiare #donghothoitrang #đồnghồđeotay #đhnam #đhnu #donghodeotay #đồnghồcaocấp  #chinhhang #giare #chongnuoc #chongxuoc #đồnghồnam #donghodayda #đồnghồ #Jenises\n', '₫90.000', 0, '', '2022-05-27 22:07:30', '2022-05-27 22:07:30', 0, 0, 0, 0),
