	(82, 'Yêu thích+Đồng hồ WR unisex dây hơp kim đen WR45', 'Mặt đồng hồ Kỹ thuật số@@@Đồng hồ đeo tay Khác@@@Kiểu đồng hồ Thời trang@@@Loại bảo hành Bảo hành nhà cung cấp@@@Đường kính vỏ đồng hồ 28mm@@@Kiểu vỏ đồng hồ Vuông@@@Chất liệu vỏ đồng hồ Thép không gỉ@@@Kiểu khóa đồng hồ Khóa gài/móc@@@Chất liệu dây đeo Hợp kim@@@Tính năng Bấm giờ@@@Độ sâu chống nước <30m@@@Kính đồng hồ Kính Cường Lực@@@Xuất xứ Việt Nam@@@Hạn bảo hành 6 tháng@@@Chất liệu Kim loại, Nhựa@@@Tên tổ chức chịu trách nhiệm sản xuất CÔNG TY TNHH THƯƠNG MẠI DỊCH VỤ THỦY HOÀ@@@Địa chỉ tổ chức chịu trách nhiệm sản xuất 21 Đường 35, Khu Phố 1, Phường Bình Trưn@@@Kho hàng 970@@@Gửi từ Thành Phố Buôn Ma Thuột, Đắk Lắk', 'Có 1 màu : đen\n✚ Sản Phẩm : WR\n✚ Tình trạng : mới\n✚ Đồng hồ : nam nữ\n✚ Chất liệu khung đồng hồ: thép không gỉ\n✚ Chất liệu kính: Chống xước tốt.\n✚ Loại dây đeo: thép không gỉ\n✚ Chức năng hiển thị: Giờ, Phút, Giây, ngày, tháng\n✚ Năng lượng: dùng pin\n✚ Khả năng chống nước: chống nước sinh hoạt\n✚ Bảo hành: 6 tháng\n\n➥ Cam Kết ★★\n? GIAO HÀNG & THANH TOÁN (COD) TẬN NƠI TRÊN TOÀN QUỐC.\n? ? BẢO HÀNH MÁY 6 THÁNG, PIN 12 THÁNG, 1 ĐỔI 1 TRONG VÒNG 7 NGÀY NẾU SẢN PHẨM LÀ LỖI CỦA NHÀ SẢN XUẤT\n? KHÔNG BẢO HÀNH TRẦY XƯỚC BÊN NGOÀI\n#dongho #đồnghồnữ #sale #sangtrong #donghosapphire #donghothoitrang #donghonu #thoitrang #donghocaocap #donghogiare #donghodoi #đồnghồ #đồnghồnam #donghonam #chongnuoc', '₫31.000', 0, '', '2022-05-27 22:07:30', '2022-05-27 22:07:30', 0, 0, 0, 0),
	(83, 'Đồng hồ Quartz WWOOR chống thấm nước kiểu dáng hợp thời trang có thể xem lịch 8830', 'Thương hiệu Kim@@@Mặt đồng hồ Thạch anh@@@Đồng hồ đeo tay Thời trang@@@Kiểu đồng hồ Trung Quốc@@@Xuất xứ 59986@@@Kho hàng Nước ngoài@@@Gửi từ undefined', 'Thời gian giao hàng dự kiến cho sản phẩm này là từ 7-9 ngày\n\nPhong cách: thời trang, giản dị, kiểu dáng văn phòng, cổ điển\nThương hiệu: WWOOR\nDành cho: Nam \nMáy đồng hồ: Máy đồng hồ Nhật Bản \nLoại pin: Pin 3 năm\nĐường kính vỏ: 40mm\nĐộ dày vỏ: 10.8mm\nChiều dài dây: 210mm\nChiều rộng dây: 19.5-23mm\nLoại khóa: Khóa gài\nKhối lượng tịnh: 108g\nPhong cách: Thời trang ﹠ Giản dị\nĐộ sâu kháng nước: 30M\nLưu ý: 1. Hỗ trợ rửa tay và tắm trong nước lạnh, nhưng không hỗ trợ bơi và lặn. Vui lòng không chạm vào nước nóng hoặc sử dụng đồng hồ dưới nước.\n2. Do chênh lệch cài đặt ánh sáng và màn hình, màu sắc sản phẩm có thể hơi khác so với hình ảnh. Xin cảm ơn bạn! \n3. Vui lòng cho phép sai số 1-3cm về số đo do cách đo lường thủ công. \n4. Vì gói hàng được chuyển từ nước ngoài về nên thời gian giao hàng tương đối chậm, thời gian khoảng nhiều ngày, mong quý khách kiên nhẫn chờ đợi, xin cảm ơn!\n\nMiêu tả sản phẩm: \nHỗ trợ dropship \n\nGói hàng bao gồm:\n1 * đồng hồ chính hãng\n2 * hộp đựng của thương hiệu\n3 * hướng dẫn sử dụng', '₫240.000', 0, 'Đen@@@Màu xanh da trời@@@Vàng@@@Vàng / đen@@@Xanh trắng@@@Vàng xanh / vàng hồng', '2022-05-27 22:07:30', '2022-05-27 22:07:30', 0, 0, 0, 0);
